import React from 'react';

function Log(props) {
    return (
        <div className="log">
            <p>
                {props.timeStamp}
                <button>stack</button>
                {props.log}
            </p>
            <h3>{props.timeStamp} | {props.category} | {props.log} | {props.stackTrace}</h3>
        </div>
    );
}

export default Log;
